
import base64
import numpy as np
import cv2
import os


def base64tomdms(base64_image):
    # Decode the base64 string
    image_bytes = base64.b64decode(base64_image)

    # Convert the image data to a Numpy array
    image_array = np.frombuffer(image_bytes, dtype=np.uint8)

    # Read the image using cv2.imdecode
    decoded_image = cv2.imdecode(image_array, cv2.IMREAD_COLOR)
    return decoded_image

def isFingerprintMatch(incoming_fp, stored_fp):
    score=0
    image=None
    kp1,kp2,mp=None,None,None
    
    sift = cv2.SIFT.create()
    stored_fp = base64tomdms(stored_fp)
    incoming_fp = base64tomdms(incoming_fp)
    kp1, des1 = sift.detectAndCompute(incoming_fp, None)
    kp2, des2 = sift.detectAndCompute(stored_fp, None)
    matches = cv2.BFMatcher().knnMatch(des1, des2, k=2)

    mp = []
    for p, q in matches:
        if p.distance < 0.75 * q.distance:
            mp.append(p)
    
    if len(mp)>97:
        return True
    return False




